ails\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"2\" to update a user\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Farah B        |\r\n      | Address   | Hebron         |\r\n      | Phone     | 5555679        |\r\n    Then a confirmation message \"User account updated successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to update a user with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to update a user\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Farah B        |\r\n      | Address   | Hebron         |\r\n      | Phone     | 5555679        |\r\n    Then an error message \"ID does not exist\" should be displayed\r\n\r\n  Scenario: Admin updates a supplier's details\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"3\" to update a supplier\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Ali A          |\r\n      | Address   | Bethlehem      |\r\n      | Phone     | 5559102        |\r\n    Then a confirmation message \"User account updated successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to update a supplier with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to update a supplier\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Ali A          |\r\n      | Address   | Bethlehem      |\r\n      | Phone     | 5559102        |\r\n    Then an error message \"ID does not exist\" should be displayed\r\n\r\n########################################delete#####################################################\r\n    Scenario: Admin deletes a owner\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"1\" to delete a store owner\r\n    Then a confirmation message \"User account deleted successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to delete a owner with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to delete a store owner\r\n    Then an error message \"ID does not exist\" should be displayed\r\n\r\n  Scenario: Admin deletes a user\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"2\" to delete a user\r\n    Then a confirmation message \"User account deleted successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to delete a user with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to delete a user\r\n    Then an error message \"ID does not exist\" should be displayed\r\n\r\n  Scenario: Admin deletes a supplier\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"3\" to delete a supplier\r\n    Then a confirmation message \"User account deleted successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to delete a supplier with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to delete a supplier\r\n    Then an error message \"ID does not exist\" should be displayed","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/mohee/Desktop/sweet/use_cases/Admin/user.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Accounts","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario","name":"Admin adds a new  owner","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"the admin is logged into the system","id":"90d9b0de-62f6-4373-a5a4-da13aced724e"},{"loca " from the store owner \"Reem\"\r\n\r\n  Scenario: Supplier sends a message to a store owner\r\n    Given the supplier \"Ali\" is logged in\r\n    And the store owner \"Reem\" is registered in the system\r\n    When the supplier sends a message \"New batch of ingredients available\" to the store owner \"Reem\"\r\n    Then the store owner \"Reem\" should receive the message \"New batch of ingredients available\" from the supplier \"Ali\"\r\n\r\n \r\n  Scenario: Supplier receives a notification for a special request via email\r\n    Given the supplier \"Ali\" is logged in\r\n    And the supplier has an email \"ali@gemail.com\"\r\n    When a special request \"Urgent need for sugar supply\" is made by a store owner\r\n    Then the supplier \"Ali\" should receive an email notification at \"ali@gemail.com\" with the subject \"Special Request Notification\" and the body \"Urgent need for sugar supply\"\r\n\r\n  Scenario: User receives a message from a store owner\r\n    Given the user \"Farah\" is logged in\r\n    And the store owner \"Reem\" is registered in the system\r\n    When the store owner sends a message \"Your order is ready for pickup\" to the user \"Farah\"\r\n    Then the user \"Farah\" should receive the message \"Your order is ready for pickup\" from the store owner \"Reem\"\r\n\r\n  Scenario: User receives a message from a supplier\r\n    Given the user \"Farah\" is logged in\r\n    And the supplier \"Ali\" is registered in the system\r\n    When the supplier sends a message \"New ingredients available\" to the user \"Farah\"\r\n    Then the user \"Farah\" should receive the message \"New ingredients available\" from the supplier \"Ali\"\r\n\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n \r\n  Scenario: Manage account details and update business information\r\n    Given the store owner is logged into the system\r\n    When the store owner navigates to the \"Account Management\" section\r\n    And the store owner updates their business information with new details:\r\n      | Field            | Value              |\r\n      | Business Name    | Reem's Sweets      |\r\n      | Address          | Nablus Sweet Street |\r\n      | Contact Number   | 123-456-7890       |\r\n    Then a confirmation message \"Account details updated successfully\" should be displayed\r\n    \r\n    \r\n      Scenario: Supplier updates account details\r\n    Given the supplier \"Ali\" is logged in\r\n    And the supplier \"Ali\" has access to their account settings\r\n    When the supplier updates the contact email to \"ali@supplier.com\"\r\n    And the supplier updates the phone number to \"123-456-7890\"\r\n    Then the system should save the updated email \"ali@supplier.com\"\r\n    And the system should save the updated phone number \"123-456-7890\"\r\n    Then a confirmation message \"Account details updated successfully\" should be displayed\r\n    \r\n    \r\n    \r\n\r\n  Scenario: Store owner processes an order\r\n    Given the store owner \"Reem\" is logged in\r\n    And there is an order with status \"Pending\" from the user \"Farah\"\r\n    When the store owner marks the order as \"Processed\"\r\n    Then the system should update the order status to \"Processed\"\r\n    And the user \"Farah\" should receive a notification that their order has been processed\r\n\r\n  Scenario: Supplier tracks an order status\r\n    Given the supplier \"Ali\" is logged in\r\n    And there is an order with status \"Shipped\" from the store owner \"Reem\"\r\n    When the supplier views the order details\r\n    Then the system should display the order status as \"Shipped\"\r\n    And the supplier should be able to see the estimated delivery date\r\n\r\n  Scenario: Customer cancels an order\r\n    Given the user \"Farah\" is logged in\r\n    And there is an order with status \"Pending\"\r\n    When the user \"Farah\" cancels the order\r\n    Then the system should update the order status to \"Cancelled\"\r\n    And the store owner \"Reem\" should receive a notification that the order has been cancelled\r\n    \r\n    \r\n    ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/mohee/Desktop/sweet/use_cases/Store%20Owner/management.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Communication and Notification","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"Store owner sends a message to a user","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"the store owner \"Reem\" is logged in","id":"26f41b3a-aff7-4bbd-b734-260cd5b1b242"},{"location":{"line":5,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the user \"Farah\" is registered in the system","id":"f9cdfaed-a9da-4a09-9634-c9952fe36412"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"the store owner sends a message \"Special discount on sweets this week!\" to the user \"Farah\"","id":"3dd19073-4f16-4010-98a6-41dd6a6232e8"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"the user \"Farah\" should receive the message \"Special discount on sweets this week!\" from the store owner \"Reem\"","id":"9086a123-21c0-405f-ab6b-524717fd71cd"}],"examples":[],"id":"f3578de4-91dc-4ce8-94b2-d9e5797399e4"}},{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":"Scenario","name":"Supplier sends a message to a store owner","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"Given ","keywordType":"Context","text":"the supplier \"Ali\" is logged in","id":"d6a40c6e-a851-45aa-9165-7f20c1fec2ca"},{"location":{"line":11,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the store owner \"Reem\" is registered in the system","id":"3e427d14-0455-49f2-908d-850b4ad353e3"},{"location":{"line":12,"column":5},"keyword":"When ","keywordType": te Cake\"\r\n\r\n  Scenario: User filters recipes based on dietary needs or food allergies\r\n    Given the user \"Farah\" is logged in\r\n    When the user navigates to the \"Recipes\" section\r\n    And the user applies a filter for \"Gluten-Free\"\r\n    Then the system should display only \"Gluten-Free\" recipes\r\n\r\n  Scenario: Purchase desserts directly from store owners\r\n    Given the user is on a store owner's page\r\n    When the user selects a dessert to purchase\r\n    And the user enters the payment details:\r\n      | Field        | Value              |\r\n      | Credit Card  | 1234-5678-9012-3456|\r\n      | Expiry Date  | 8/25              |\r\n      | CVV          | 123                |\r\n    And the user submits the payment\r\n    Then a confirmation message \"Purchase completed successfully\" should be displayed\r\n    And the user should receive an email receipt\r\n\r\n\r\n\r\n  Scenario: Directly communicate with store owners and suppliers for inquiries or assistance\r\n    Given the user is logged into the system\r\n    When the user navigates to the \"Contact\" section on a store owner's page\r\n    And the user sends a message \"I have a question about your chocolate cake recipe.\"\r\n    Then the message should be sent to the store owner\r\n    And a confirmation message \"Message sent successfully\" should be displayed\r\n\r\n  Scenario: Provide feedback on purchased products\r\n    Given the user is logged into the system\r\n    When the user navigates to the \"Order History\" section\r\n    And the user selects an order to provide feedback\r\n    And the user enters the feedback \"The chocolate cake was delicious!\"\r\n    And the user submits the feedback\r\n    Then a confirmation message \"Thank you for your feedback\" should be displayed\r\n    And the feedback should be visible under the product's reviews\r\n\r\n  Scenario: Provide feedback on shared recipes\r\n    Given the user is logged into the system\r\n    When the user navigates to a shared recipe page\r\n    And the user enters the feedback \"Great recipe! Easy to follow.\"\r\n    And the user submits the feedback\r\n    Then a confirmation message \"Thank you for your feedback\" should be displayed\r\n    And the feedback should be visible under the recipe's reviews\r\n    \r\n    \r\n    \r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/mohee/Desktop/sweet/use_cases/User/Purchase.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Beneficiary User Exploration and Purchase","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"User browses and searches for dessert recipes","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"the user \"Farah\" is logged in","id":"0a8d3251-55f0-433f-8793-37d47d938355"},{"location":{"line":5,"column":5},"keyword":"When ","keywordType":"Action","text":"the user navigates to the \"Recipes\" section","id":"e7d5b2e8-896a-4203-b617-8e6efdf37f11"},{"location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the user searches for \"Chocolate Cake\"","id":"f3bebd9e-2a6f-48fc-ba77-1cad58469846"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"the system should display a list of recipes related to \"Chocolate Cake\"","id":"47273a57-58ed-4600-adbb-9167838d27d5"}],"examples":[],"id":"4bbcc4b2-ee33-43ce-b3fa-8046e4615cac"}},{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":"Scenario","name":"User filters recipes based on dietary needs or food allergies","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"Given ","keywordType":"Context","text":"the user \"Farah\" is logged in","id":"33c2226d-d762-4331-bc33-a4bc1b62ee1b"},{"location":{"line":11,"column":5},"keyword":"When ","keywordType":"Action","text"
